import React from "react";
import { useNavigate } from "react-router-dom";


//new
// Update your Login component to include the following import
// import { useState } from "react";

// ... other imports ...

const Login = () => {
  const navigate = useNavigate();
  const [email, setEmail] = useState("");
  const [applicationNo, setApplicationNo] = useState("");

  const handleLoginButtonClick = async () => {
    try {
      const response = await fetch("http://localhost:5000/login", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({ email, applicationNo }),
      });

      if (response.ok) {
        console.log("User details saved successfully!");
        navigate("/admin/user-profile");
      } else {
        console.error("Failed to save user details");
      }
    } catch (error) {
      console.error("Error:", error);
    }
  };

  // ... rest of the component ...

  return (
    <>
      {/* ... rest of the component ... */}
      <Form role="form">
        <FormGroup className="mb-3">
          {/* ... rest of the component ... */}
          <Input
            placeholder="Email"
            type="email"
            autoComplete="new-email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />
        </FormGroup>
        <FormGroup>
          {/* ... rest of the component ... */}
          <Input
            placeholder="Application No."
            type="Application No."
            autoComplete="new-Application No."
            value={applicationNo}
            onChange={(e) => setApplicationNo(e.target.value)}
          />
        </FormGroup>
        <div className="text-center">
          <Button className="my-4" color="primary" type="button" onClick={handleLoginButtonClick}>
            Sign in
          </Button>
        </div>
      </Form>
      {/* ... rest of the component ... */}
    </>
  );
};
//finish

